# Ajout des stats min
folk = Folk(
  fight=fight_min,
  plot=plot_min,
  scholarship=scholarship_min,
  diplomacy=diplomacy_min,
  loyalty=loyalty
)
# Ajout du kingdom 
if "kingdom" in locals():
  folk.kingdom=kingdom
# Ajout de son sexe
if "sex" in locals():
  folk.sex=sex
else:
  folk.sex=random_in([Folk.FEMALE,Folk.MALE])
# Ajout des statistiques complètes
if folk.sex == Folk.MALE:
  # Si c'est un homme
  sum_stats = call_function("somme_stat_folk", folk=folk)
  while sum_stats < max_carac :
    fight = (20 - folk.fight) * float(100 / float(80 - sum_stats))
    plot = (20 - folk.plot) * float(100 / float(80 - sum_stats))
    scholarship = (20 - folk.scholarship) * float(100 / float(80 - sum_stats))
    diplomacy = (20 - folk.diplomacy) * float(100 / float(80 - sum_stats))
    choose_attribute = random_value(1,100)
    if choose_attribute < fight:
      folk.fight += 1
    elif choose_attribute < fight + plot :
      folk.plot += 1
    elif choose_attribute < fight + plot + scholarship :
      folk.scholarship += 1
    else :
      folk.diplomacy += 1
    sum_stats += 1
else:
  # Si c'est une femme
  folk.fight= random_gauss(2,11)
  sum_stats = call_function("somme_stat_folk", folk=folk) - folk.fight

  while sum_stats < max_carac - folk.fight:
    plot = (20 - folk.plot) * float(100 / float(60 - sum_stats))
    scholarship = (20 - folk.scholarship) * float(100 / float(60 - sum_stats))
    diplomacy = (20 - folk.diplomacy) * float(100 / float(60 - sum_stats))

    choose_attribute = random_value(1,100)  
    if choose_attribute < plot :
      folk.plot += 1
    elif choose_attribute < plot + scholarship :
      folk.scholarship += 1
    else :
      folk.diplomacy += 1
    sum_stats += 1
# Ajout du last_name
if "last_name" in locals():
  #s'il y a déjà d' ou de devant
  if last_name.startswith("de ") or last_name.startswith("d'"):
    folk.last_name = last_name
  else:
    if last_name[0] in ['a','e','i','o','u','y','A','E','I','O','U','Y']:
      folk.last_name = "d'" + last_name
    else:
      folk.last_name = "de " + last_name

# Ajout des parents
if "father" in locals():
  folk.father = father
if "mother" in locals():
  folk.mother = mother
# Ajout de l'epoux
if "spouse" in locals():
  folk.spouse = spouse
# Ajout de la date de naissance
if "birth" in locals():
  folk.birth = birth

folk.save()

# Ajout des traits
choose_quality = random_value(1, 10)
exculded_traits = []
if "notraits" in locals():
  exculded_traits = notraits

if choose_quality > 1 :
  if random_value(1,10) <= 1:
    folk.add_quality(Quality.objects.filter(category__name="Génétique").exclude(slug__in=exculded_traits).order_by('?')[0].slug)
  else:
    folk.add_quality(Quality.objects.filter(category__name="Caractère").exclude(slug__in=exculded_traits).order_by('?')[0].slug)

  if choose_quality > 8 :
    folk.add_quality(Quality.objects.filter(category__name="Caractère").exclude(slug__in=exculded_traits).order_by('?')[0].slug)

if "trait" in locals():
  folk.add_quality(trait)

if "traits" in locals():
  for trait in traits:
    folk.add_quality(trait)

folk.save()
call_function("attribuer_avatar", folk=folk)

param = folk

if folk.age() < C.MAJORITE:
  #Attribuer l'avatar d'enfant
  folk.avatar = Avatar.objects.filter(sex=folk.sex).exclude(child='').order_by('?')[0]
else:
  # Attribuer l'avatar d'adulte
  caracs = {
    'fight': folk.fight,
    'diplomacy': folk.diplomacy,
    'plot': folk.plot,
    'scholarship': folk.scholarship
  }

  best_carac = sorted(caracs.items(), key=lambda c: c[1])[0]

  params = {
    best_carac[0]: Avatar.FORBIDDEN
  }

  folk.avatar = Avatar.objects.filter(sex=folk.sex, child='').exclude(**params).order_by('?')[0]

folk.save()

